import styled from "styled-components"

const PostPhotoContainer = styled.div`
  .renderedPhotos {
    border-top-left-radius: 10px;
    border-top-right-radius: 10px;
    width: 100%;
    height: 50px;
    object-fit: cover;
  }
`

export { PostPhotoContainer }
